  \"2016-02-06T16:41:16.041611\",\n\t\"name\": \"irondale-gulch-draft-water-management-plan-for-rocky-mountain-arsenal-national-wildlife-ar\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Rocky Mountain Arsenal and Irondale
  Gulch draft Water Management Plan has been developed to meet the station objectives
  set forth in the Master Plan.  The purpose of this plan is to establish a schedule
  of operations for the manipulation of managed waters. Draft proposal by U.S. Fish
  and Wildlife Service for alternative flood control on the Irondale Gulch watershed
  at Rocky Mountain Arsenal National Wildlife Area.  Constraints to flood water control
  include preserving fish and wildlife habitat and minimizing the effects of infiltration
  of contaminants.  Fourteen different existing basins for potential flood water storage
  and infiltration were evaluated.  A amp of the locations of the 14 basins and a
  table of a preliminary impact analysis are included in this plan.\",\n\t\"license_title\":
